// Private.js
import React from 'react';
import { Link } from 'react-router-dom';

const Private = () => {
  return (
    <div>
      <h2>Private Page</h2>
      <p>This is a private page. You are logged in.</p>
      <p><Link to="/logout">Log Out</Link></p>
    </div>
  );
};

export default Private;
